n_qubits = 153

# Convert to stim PauliString objects
pauli_strings = []
for s in stabilizers:
    pauli_strings.append(stim.PauliString(s))

print(f"Number of stabilizers: {len(pauli_strings)}")
print(f"Each stabilizer has length: {len(stabilizers[0])}")

# Check commutativity
def commutes(p1, p2):
    # Two Pauli strings commute if they have an even number of positions where
    # both have non-identity and non-equal single-qubit Paulis
    anticomm_count = 0
    for i in range(len(p1)):
        c1 = str(p1)[i] if i < len(str(p1)) else 'I'
        c2 = str(p2)[i] if i < len(str(p2)) else 'I'
        if c1 != 'I' and c2 != 'I' and c1 != c2:
            anticomm_count += 1
    return anticomm_count % 2 == 0

# Check all pairs
anticommuting = []
for i in range(len(stabilizers)):
    for j in range(i+1, len(stabilizers)):
        if not commutes(pauli_strings[i], pauli_strings[j]):
            anticommuting.append((i, j))

print(f"Anticommuting pairs: {len(anticommuting)}")
if anticommuting:
    print(f"First few: {anticommuting[:5]}")

# Try using stim's built-in functionality
try:
    tab = stim.Tableau.from_stabilizers(pauli_strings, allow_underconstrained=True, allow_redundant=True)
    circuit = tab.to_circuit(method='elimination')
    print(f"Circuit generated with {len(circuit)} operations")
    print(circuit)
except Exception as e:
    print(f"Error: {e}")
